  return (
    <Fragment>
        <Navbar
            items={["Vinilos", "BluRay", "Poleras", "Accesorios", "Contacto"]}
            navbarLogoCss={"text-danger navbar-brand"}
            navbarLogo={"BIG STORE"}
        />
        {/*Contenido din√°mico*/}
        {props.children}
        <Footer/>
    </Fragment>
  );
};

export default Container
